How to Create Help Text
Help text is the little box that appears in the upper left corner of your game.
You cannot change the position of this text.
Example
alt.onServer('showHelpText', showHelpText);

export function showHelpText(text, milliseconds) {
    native.beginTextCommandDisplayHelp('STRING');
    native.addTextComponentScaleform(text);
    native.endTextCommandDisplayHelp(0, 0, 0, milliseconds);
}

Example Usage
Server Side
alt.on('playerConnect', (player) => {
    alt.emitClient(player, 'showHelpText', 'Press ~INPUT_MOVE_UP_ONLY~ to move forward.', 5000);
});

Client Side
showHelpText('Press ~INPUT_MOVE_UP_ONLY~ to move forward.', 5000);

docs/articles/snippets/notifications.htm.body:
How to Build a Notification
Notifications are the black boxes that appear above your map on bottom left-hand side.
They are only accessible from client-side but you can call them from server-side by creating an event handler that triggers something ont he client-side.
See the example below on how to utilize this in two different ways.
Example
import * as alt from 'alt-client';
import * as native from 'natives';

alt.onServer('drawNotification', drawNotification);

export function drawNotification(imageName, headerMsg, detailsMsg, message) {
    native.beginTextCommandThefeedPost('STRING');
    native.addTextComponentSubstringPlayerName(message);
    native.endTextCommandThefeedPostMessagetextTu(
        imageName.toUpperCase(),
        imageName.toUpperCase(),
        false,
        4,
        headerMsg,
        detailsMsg,
        1.0,
        ''
    );
    native.endTextCommandThefeedPostTicker(false, false);
}

Example Usage
Server Side
alt.emitClient(player, 'drawNotification', 'CHAR_AMMUNATION', 'Header', 'Small Details', 'The rest of the owl.');

Client Side
drawNotification('CHAR_AMMUNATION', 'Header', 'Small Details', 'The rest of the owl.');

docs/articles/snippets/password-encrypti.body:
Encryption / Password Hashing
The following method requires a library called sjcl, You can install it by running npm install sjcl in your terminal.
Snippet
Encryption
import sjcl from 'sjcl';

/**
 * Hash a password with pbkdf2
 * @param {string} password
 * @returns {string} A password hash.
 */
export function encryptPassword(password) {
    const saltBits = sjcl.random.randomWords(2, 0);
    const salt = sjcl.codec.base64.fromBits(saltBits);
    const key = sjcl.codec.base64.fromBits(sjcl.misc.pbkdf2(password, saltBits, 2000, 256));
    return `${key}$${salt}`;
}

Verification
import sjcl from 'sjcl';

/**
 * Verify a password matches with pbkdf2.
 * @param {string} password
 * @param {string} storedPasswordHash
 * @returns {bool} true if correct password
 */
export function verifyPassword(password, storedPasswordHash) {
    const [_key, _salt] = storedPasswordHash.split('$');
    const saltBits = sjcl.codec.base64.toBits(_salt);
    const derivedKey = sjcl.misc.pbkdf2(password, saltBits, 2000, 256);
    const derivedBaseKey = sjcl.codec.base64.fromBits(derivedKey);

    if (_key != derivedBaseKey) {
        return false;
    }

    return true;
}

Example Usage
Serverside
const hash = encryptPassword('test');
const isCorrectPassword = verifyPassword('test', hash);

if (isCorrectPassword) {
    console.log(`That was a correct password.`);
}

