docs/articles/snippets/textlabels.html.body:
How to Create 2D & 3D Text Labels
I must preface this snippet by stating that you should be using distance to scale your text as well as preventing it from drawing when the player is not near the text. It is also important to understand that this must be done on client-side.
Keep in mind that x and y are percentages of your player's full screen resolution when drawing 2D elements. Values may range from 0 - 1. Meaning 0.5 is the center of the screen.
Here's what these labels may look like in a 2D space.

2D Text Draws
export function drawText2d(
    msg,
    x,
    y,
    scale,
    fontType,
    r,
    g,
    b,
    a,
    useOutline = true,
    useDropShadow = true,
    layer = 0,
    align = 0
) {
    let hex = msg.match('{.*}');
    if (hex) {
        const rgb = hexToRgb(hex[0].replace('{', '').replace('}', ''));
        r = rgb[0];
        g = rgb[1];
        b = rgb[2];
        msg = msg.replace(hex[0], '');
    }

    native.beginTextCommandDisplayText('STRING');
    native.addTextComponentSubstringPlayerName(msg);
    native.setTextFont(fontType);
    native.setTextScale(1, scale);
    native.setTextWrap(0.0, 1.0);
    native.setTextCentre(true);
    native.setTextColour(r, g, b, a);
    native.setTextJustification(align);

    if (useOutline) {
        native.setTextOutline();
    }

    if (useDropShadow) {
        native.setTextDropShadow();
    }

    native.endTextCommandDisplayText(x, y);
}

Drawing 3D Text
Please use distance calculation to prevent text from being drawn while the player is across the map. Ensure they are within the range of where you are drawing your text before rendering it.
export function drawText3d(
    msg,
    x,
    y,
    z,
    scale,
    fontType,
    r,
    g,
    b,
    a,
    useOutline = true,
    useDropShadow = true,
    layer = 0
) {
    let hex = msg.match('{.*}');
    if (hex) {
        const rgb = hexToRgb(hex[0].replace('{', '').replace('}', ''));
        r = rgb[0];
        g = rgb[1];
        b = rgb[2];
        msg = msg.replace(hex[0], '');
    }

    native.setDrawOrigin(x, y, z, 0);
    native.beginTextCommandDisplayText('STRING');
    native.addTextComponentSubstringPlayerName(msg);
    native.setTextFont(fontType);
    native.setTextScale(1, scale);
    native.setTextWrap(0.0, 1.0);
    native.setTextCentre(true);
    native.setTextColour(r, g, b, a);

    if (useOutline) {
        native.setTextOutline();
    }

    if (useDropShadow) {
        native.setTextDropShadow();
    }

    native.endTextCommandDisplayText(0, 0);
    native.clearDrawOrigin();
}

Example Usage
Client Side
alt.setInterval(() => {
    drawText2d('Hello from Top Center of Screen', 0.5, 0.05, 0.4, 4, 255, 255, 255, 255);

    const playerPos = { ...alt.Player.local.pos };
    drawText3d(`This is You`, playerPos.x, playerPos.y, playerPos.z, 0.3, 4, 255, 255, 255, 255);
}, 0);

docs/articles/snippets/voice.html.body:
How to use alt:V Voice
alt:V has its own built-in voice server into the server itself. It has been tested up to 500~ players and has generally worked quite well. It is recommended to try out the voice option in alt:V before looking at third-party options as it already handles distance and panning.
Enabling Voice
Inside of your server.cfg introduce a section called voice with something along the lines of:
voice: {
    bitrate: 64000
},
Creating a Voice Channel
import * as alt from 'alt-server';

// The last parameter is the maximum distance of this channel.
let mainChannel = new alt.VoiceChannel(true, 25);

// Call this function to allow the player to speak and hear everyone
// else in the global channel.
export function addToGlobalVoice(player) {
    if (mainChannel.isPlayerInChannel(player)) {
        return;
    }

    mainChannel.addPlayer(player);
}

// Call this function to remove the player and stop them from
// speaking or hearing anyone else.
export function removeFromGlobalVoice(player) {
    if (!mainChannel.isPlayerInChannel(player)) {
        return;
    }

    mainChannel.removePlayer(player);
}

