docs/playerClient/getMeta.html.body:
player.getMeta
Description
Used to store cross-resource accessible information. This functionality stores an object on a player that can be set with setMeta.
This type of meta is only accessible where it is created.
If it is created on the client-side it is only accessible on the client-side.
If it's created on the server-side it is only accessible on the server-side.
Syntax
getMeta(key: string, value: any): void;

Example Usage
const result = alt.Player.local.getMeta('myData');
if (!result) {
    // Data does not exist
    return;
}

console.log(result);

alt.Player.local can also be a player instance from server

docs/playerClient/getStreamSyncedMeta.ht.body:
player.getStreamSyncedMeta
Description
Used to store cross-resource accessible information. This functionality stores an object on a player that can only be set on server-side with setStreamSyncedMeta.
The player on client-side is only updated if they are in streaming range of another player.
This type of meta is accessible anywhere but can only be set on server-side.
Syntax
getStreamSyncedMeta(key: string): void;

You can store literally anything. Except functions.
Example Usage
const data = alt.Player.local.getStreamSyncedMeta('myData');
if (!data) {
    // Does does not exist.
    return;
}

console.log(data);

